nsions' => '<p>Lists all schema extensions applied to a Microsoft AD Directory.</p>', 'ListTagsForResource' => '<p>Lists all tags on a directory.</p>', 'RegisterCertificate' => '<p>Registers a certificate for a secure LDAP or client certificate authentication.</p>', 'RegisterEventTopic' => '<p>Associates a directory with an SNS topic. This establishes the directory as a publisher to the specified SNS topic. You can then receive email or text (SMS) messages when the status of your directory changes. You get notified if your directory goes from an Active status to an Impaired or Inoperable status. You also receive a notification when the directory returns to an Active status.</p>', 'RejectSharedDirectory' => '<p>Rejects a directory sharing request that was sent from the directory owner account.</p>', 'RemoveIpRoutes' => '<p>Removes IP address blocks from a directory.</p>', 'RemoveRegion' => '<p>Stops all replication and removes the domain controllers from the specified Region. You cannot remove the primary Region with this operation. Instead, use the <code>DeleteDirectory</code> API.</p>', 'RemoveTagsFromResource' => '<p>Removes tags from a directory.</p>', 'ResetUserPassword' => '<p>Resets the password for any user in your AWS Managed Microsoft AD or Simple AD directory.</p> <p>You can reset the password for any user in your directory with the following exceptions:</p> <ul> <li> <p>For Simple AD, you cannot reset the password for any user that is a member of either the <b>Domain Admins</b> or <b>Enterprise Admins</b> group except for the administrator user.</p> </li> <li> <p>For AWS Managed Microsoft AD, you can only reset the password for a user that is in an OU based off of the NetBIOS name that you typed when you created your directory. For example, you cannot reset the password for a user in the <b>AWS Reserved</b> OU. For more information about the OU structure for an AWS Managed Microsoft AD directory, see <a href="https://docs.aws.amazon.com/directoryservice/l